measurements.description:
Twelve full flowers racked well on one arching 78cm inflorescence;
	sepals and petals smooth pink-lavender, petals lightly veined with slightly darker lavender centrally;
	lip midlobe and slightly broadened side lobes pink-lavender, throat magenta-spotted on and near white calli;
	column white, anther cap white blushed with pink; substance average; texture crystalline.
